import Gallery from './components/gallery';
import './App.css';
import one from './components/assets/images/1.jpg';

const GalleryData = [
  {
    image:{one},
    title: "BlacK cover",
  }
];
function App() {
  return (
    <div>
      {
        GalleryData.map((gallery)=>{
          const {image, title} = gallery;
          return (
            <Gallery image={image} title={title} />
          )
        })
      }
    </div>
  );
}

export default App;
